import React from "react";
import logo from "./assets/whitetransparent.png";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className="">Handmade in Spain, Designed in San Antonio, Texas</p>
        <a
          className="App-link"
          href="https://stylebyjm.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn More
        </a>
      </header>
    </div>
  );
}

export default App;
